import {createContext} from 'react';

 const SuspeitoContext = createContext();

 const SuspeitoProviders = ({children}) => {
    this.state = {
        Motorista : false,
        Empregada : false,
        Mordomo : false,
        Cozinheiro : false,
        Esposa : false,
        Jardineiro : false,
        Vizinho : false
      }
 }
 

 export default SuspeitoProviders;
